import React,{useState} from 'react'
import {getLoginList} from './Nodeservices'
import { Paper, makeStyles, TableBody, TableRow, TableCell, Toolbar, InputAdornment } from '@material-ui/core';
import useTable from './UseTable'
import { Search } from "@material-ui/icons";
import { TextField } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import Switch from '@material-ui/core/Switch';
import Grid from '@material-ui/core/Grid';
const useStyles = makeStyles(theme => ({
    pageContent: {
        margin: theme.spacing(5),
        padding: theme.spacing(3)
    },
    searchInput: {
        width: '75%'
    }
}))


const headCells = [
    { id: 'name', label: 'Name' },
    { id: 'email', label: 'Email Address' },
    { id: 'date', label: 'Date' },
    { id: 'time', label: 'Time'},
]

const LoginUserList=()=>{

    const [state, setState] = React.useState({
		checkedA: false,
		checkedB: true,
	  });

	  const [flag,setFlag]=React.useState(true)

	  const handleChange2 = (event) => {
		  if(flag==false){
			setFlag(true)
		  }
		  else{
			setFlag(false)
		  }
	  };
	  console.log(flag)

    const classes = useStyles();
    const [getList,setList]=React.useState([])
    const fetchData=async()=>{

      var result=await getLoginList('userloginlist')
      setList(result)
      console.log(result)
    }
    React.useEffect(function(){
      fetchData()

    },[])

    const [filterFn, setFilterFn] = useState({ fn: items => { return items; } })

    const {
        TblContainer,
        TblHead,
        TblPagination,
        recordsAfterPagingAndSorting
    } = useTable(getList, headCells, filterFn);

    const handleSearch = e => {
        let target = e.target;
        setFilterFn({
            fn: items => {
                if (target.value == "")
                    return items;
                else
                    return items.filter(x => x.name.toLowerCase().includes(target.value))
            }
        })
    }

    console.log(getList)

    return(<>
    <div>
        <center>
            <h1>User Login List</h1>
        </center>
    </div>
    <center>
				<Typography component="div">
					<center>
					<Grid component="label" container alignItems="center" spacing={1}>
					<Grid item><b>All Time</b></Grid>
						<Grid item>
							<Switch checked={flag?state.checkedA:state.checkedB} value={flag} onChange={handleChange2}/>
						</Grid>
					<Grid item><b>By Count</b></Grid>
					</Grid>
					</center>
				</Typography>
	</center>
    <div>
        {flag?
        <>
        <Paper className={classes.pageContent}>
            
            <Toolbar>
                <TextField
                    label="Search Users"
                    className={classes.searchInput}
                    InputProps={{
                        startAdornment: (<InputAdornment position="start">
                            <Search />
                        </InputAdornment>)
                    }}
                    onChange={handleSearch}
                />
            </Toolbar>
            <TblContainer>
                <TblHead />
                <TableBody>
                    {
                        recordsAfterPagingAndSorting().map(item =>
                            (<TableRow key={item.id}>
                                <TableCell>{item.name}</TableCell>
                                <TableCell>{item.emailid}</TableCell>
                                <TableCell>{item.date}</TableCell>
                                <TableCell>{item.time}</TableCell>
                            </TableRow>)
                        )
                    }
                </TableBody>
            </TblContainer>
            <TblPagination />
        </Paper>
        </>
        :
        <>
        </>
        }
    
    </div>
    </>)
}

export default LoginUserList
